import React from 'react';
import '../../App.css';
import Navbar from '../Navbar';
export default function Products() {
  return (
    <>
    <div className='hero-container'>
      <div className = 'homeBackground' style = {{ height: 500 }}> 
        <Navbar />
        <h1 className='prices'>PRICING</h1>`
      </div>
    </div>
    </>
  );
}
